import Link from "next/link";

const NavLink = ({ href, text }) => (
  <Link href={href}>
    <a>{text}</a>
  </Link>
);

const NavBar = () => {
  return (
    <div className="bg-gray-500 py-4">
      <Link href="/sobre">
        <a>Sobre</a>
      </Link>
      <Link href="/cadastro">
        <a>Cadastro</a>
      </Link>
      <Link href="/entrar">
        <a>Entrar</a>
      </Link>
    </div>
  );
};

export default NavBar;
